import React, { useState, useEffect } from 'react';
import { 
  Container, 
  TextField, 
  Button, 
  Typography, 
  Box,
  Link,
  Alert
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import PersonOutlineIcon from '@mui/icons-material/PersonOutline';
import EmailOutlinedIcon from '@mui/icons-material/EmailOutlined';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import VpnKeyOutlinedIcon from '@mui/icons-material/VpnKeyOutlined';
import axios from 'axios';
import { useAuth } from '../../context/AuthContext';

const API_URL = 'http://127.0.0.1:5000';

function Register() {
  const { logout } = useAuth(); // Add this
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    confirmPassword: '',
  });

  const [errors, setErrors] = useState({});
  const [apiError, setApiError] = useState('');
  const [success, setSuccess] = useState('');
  const navigate = useNavigate();

  // Clear authentication when component mounts
  useEffect(() => {
    logout();
  }, [logout]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
    if (errors[name]) {
      setErrors(prevErrors => ({
        ...prevErrors,
        [name]: ''
      }));
    }
    if (apiError) {
      setApiError('');
    }
  };

  const validateForm = () => {
    const newErrors = {};

    if (!formData.firstName.trim()) {
      newErrors.firstName = 'First name is required';
    }

    if (!formData.lastName.trim()) {
      newErrors.lastName = 'Last name is required';
    }

    if (!formData.email.trim()) {
      newErrors.email = 'Email is required';
    } else if (!/\S+@\S+\.\S+/.test(formData.email)) {
      newErrors.email = 'Email is invalid';
    }

    if (!formData.password) {
      newErrors.password = 'Password is required';
    } else if (formData.password.length < 6) {
      newErrors.password = 'Password must be at least 6 characters';
    }

    if (formData.password !== formData.confirmPassword) {
      newErrors.confirmPassword = 'Passwords do not match';
    }


    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setApiError('');
    setSuccess('');

    if (validateForm()) {
      try {
        const response = await axios.post(
          `${API_URL}/register`,
          {
            email: formData.email,
            password: formData.password,
            first_name: formData.firstName,
            last_name: formData.lastName,
          },
          {
            headers: {
              'Content-Type': 'application/json'
            }
          }
        );

        console.log('Registration successful:', response.data);
        setSuccess('Registration successful! Redirecting to login...');

        // Clear form
        setFormData({
          firstName: '',
          lastName: '',
          email: '',
          password: '',
          confirmPassword: '',
        });

        // Redirect to login after delay
        setTimeout(() => {
          logout(); // Ensure logged out state before navigating
          navigate('/login');
        }, 2000);

      } catch (err) {
        console.error('Registration error:', err);
        if (!err.response) {
          setApiError('Unable to connect to the server. Please try again later.');
        } else {
          setApiError(err.response?.data?.error || 'Registration failed. Please try again.');

          if (err.response?.data?.error?.includes('Email already registered')) {
            setErrors(prev => ({
              ...prev,
              email: 'This email is already registered'
            }));
          }
        }
      }
    }
  };

  const handleLoginClick = (e) => {
    e.preventDefault();
    logout(); // Clear auth state before navigating
    navigate('/login');
  };


  return (
    <Box
      sx={{
        minHeight: 'calc(100vh - 64px)',
        background: '#F9F9F9',
        position: 'relative',
        overflow: 'hidden',
        display: 'flex',
        alignItems: 'center',
      }}
    >
      <Container maxWidth="xs">
        <Box
          sx={{
            position: 'relative',
            zIndex: 2,
            p: 4,
            background: '#FFFFFF',
            borderRadius: 2,
            border: '1px solid #E0E6ED',
            boxShadow: '0 4px 24px 0 rgba(0, 122, 255, 0.06)',
          }}
        >
          <Typography
            variant="h3"
            sx={{
              mb: 4,
              textAlign: 'center',
              fontWeight: 700,
              color: '#007AFF',
              letterSpacing: '-0.02em',
            }}
          >
            Create Account
          </Typography>

          {apiError && (
            <Alert 
              severity="error" 
              sx={{ 
                mb: 2,
                backgroundColor: 'rgba(0, 122, 255, 0.08)',
                color: '#007AFF',
              }}
            >
              {apiError}
            </Alert>
          )}

          {success && (
            <Alert 
              severity="success" 
              sx={{ 
                mb: 2,
                backgroundColor: 'rgba(50, 205, 50, 0.10)',
                color: '#32CD32',
              }}
            >
              {success}
            </Alert>
          )}

          <Box component="form" onSubmit={handleSubmit}>
            <Box sx={{ mb: 3 }}>
              <TextField
                required
                fullWidth
                label="First Name"
                name="firstName"
                value={formData.firstName}
                onChange={handleChange}
                InputProps={{
                  startAdornment: (
                    <Box sx={{ mr: 2, color: '#007AFF' }}>
                      <PersonOutlineIcon />
                    </Box>
                  ),
                }}
              />
            </Box>
            <Box sx={{ mb: 3 }}>
              <TextField
                required
                fullWidth
                label="Last Name"
                name="lastName"
                value={formData.lastName}
                onChange={handleChange}
                InputProps={{
                  startAdornment: (
                    <Box sx={{ mr: 2, color: '#007AFF' }}>
                      <PersonOutlineIcon />
                    </Box>
                  ),
                }}
              />
            </Box>
            <Box sx={{ mb: 3 }}>
              <TextField
                required
                fullWidth
                label="Email"
                name="email"
                type="email"
                value={formData.email}
                onChange={handleChange}
                InputProps={{
                  startAdornment: (
                    <Box sx={{ mr: 2, color: '#007AFF' }}>
                      <EmailOutlinedIcon />
                    </Box>
                  ),
                }}
              />
            </Box>
            <Box sx={{ mb: 3 }}>
              <TextField
                required
                fullWidth
                label="Password"
                name="password"
                type="password"
                value={formData.password}
                onChange={handleChange}
                InputProps={{
                  startAdornment: (
                    <Box sx={{ mr: 2, color: '#007AFF' }}>
                      <LockOutlinedIcon />
                    </Box>
                  ),
                }}
              />
            </Box>
            <Box sx={{ mb: 4 }}>
              <TextField
                required
                fullWidth
                label="Confirm Password"
                name="confirmPassword"
                type="password"
                value={formData.confirmPassword}
                onChange={handleChange}
                InputProps={{
                  startAdornment: (
                    <Box sx={{ mr: 2, color: '#007AFF' }}>
                      <VpnKeyOutlinedIcon />
                    </Box>
                  ),
                }}
              />
            </Box>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{
                py: 2,
                mb: 3,
                fontSize: '1.1rem',
                fontWeight: 600,
                background: 'linear-gradient(135deg, #007AFF 0%, #32CD32 100%)',
                borderRadius: 2,
                boxShadow: '0 4px 20px rgba(0, 122, 255, 0.08)',
                color: '#fff',
                transition: 'all 0.3s ease',
                '&:hover': {
                  background: 'linear-gradient(135deg, #32CD32 0%, #007AFF 100%)',
                  boxShadow: '0 6px 25px rgba(50, 205, 50, 0.12)',
                },
              }}
            >
              Create Account
            </Button>

            <Box
              sx={{
                textAlign: 'center',
                position: 'relative',
                '&::before, &::after': {
                  content: '""',
                  position: 'absolute',
                  top: '50%',
                  width: '30%',
                  height: '1px',
                  background: 'linear-gradient(90deg, transparent, #E0E6ED)',
                },
                '&::before': {
                  left: 0,
                },
                '&::after': {
                  right: 0,
                  transform: 'rotate(180deg)',
                },
              }}
            >
              <Link
                component="button"
                variant="button"
                onClick={handleLoginClick}
                sx={{
                  color: '#007AFF',
                  textDecoration: 'none',
                  fontWeight: 600,
                  transition: 'all 0.2s',
                  '&:hover': {
                    color: '#32CD32',
                  },
                }}
              >
                Already have an account? Sign in
              </Link>
            </Box>
          </Box>
        </Box>
      </Container>
    </Box>
  );
}

export default Register;
